import React, { Component } from "react";

import NavigationBar from '../medium/navbar';
import SignIn  from '../medium/signin ';

class LogIn extends Component {
  render() {
     return (
     <div>
       <NavigationBar/>
       <SignIn/>
     </div>
     );
  }
}

export default LogIn  ;
